CREATE TABLE IF NOT EXISTS "nixpkgs"(
  input TEXT not null,
  pname TEXT not null,
  disabled TEXT,
  comment TEXT,
  dependency TEXT,
  description TEXT,
  broken TEXT,
  unique(input, pname)
);
CREATE TABLE IF NOT EXISTS "nixpkgs_bin"(
  input TEXT not null,
  pname TEXT not null,
  bin TEXT not null unique
);
